import Navbar from "./components/Navbar";
import Login from "./components/Login"; 
import  Questions  from "./components/Questions";
import { Hamburger } from "./components/Hamburger";
import { BrowserRouter as Router, Route, Routes} from "react-router-dom";
import { SignUp } from "./components/SignUp";
import { useState } from "react";






function App() {
const [QuizIsStarted, setQuizIsStarted] = useState(false);
  return (
    <Router>
    <div>

  <Navbar />

<Routes>
<Route path="/login"  element={<Login />} />

</Routes>
<Questions quizIsStarted={QuizIsStarted}/>
<Hamburger/>
<SignUp/>

<div className="bot">

<p className="heading">Dive into the thrill of knowledge with our captivating quizzes. Click to Start Now!</p>
<button className="btn" onClick={()=>setQuizIsStarted()}>Click here to Start</button></div>
</div>
  </Router>

);
}

export default App;
